                headers: {'Content-Type': 'application/json'},
                credentials: 'include',

            });

            const content = await response.json();
            setUser(content);
        }
    )();

})
const Home = () => {
    let Home
    if(user.name == undefined){
        Home = 
            (<div>
            You are not logged in
            </div>)
    }
    else{
        Home = (<div>{'hi'+ user.name + user.email}</div>)
    }
